import React from 'react'
import Cards from './Cards'

const List = () => {
  const products = useSelector((state) => state.productReducer.products);
  return (
    <div><div style={{display:"flex",justifyContent:"space-evenly",flexWrap:"wrap",margin:"20px"}}>
    {event.map((el) => (
      <Cards el={el} key={el._id} />
    ))}
  </div></div>
  )
}

export default List
